  render() {

    const renderValues=()=> {

      return this.props.expenses.map((item, i)=>{
        total = total + item.price
            return <li key={i}>  </li>
})
    }


    return (
      <div>
      {renderValues()}
          Calculator Function
          {total}
      </div>
    );

  }

}



const mapStateToProps = (state) => {
  return { expenses : state.expenses  }
}

